import React, {Component} from 'react';

const TaskButton = ({className, testFun, id}) =>{
    if(className === 'icon icon-edit'){
        return <button className={className} onClick={()=>testFun(id, 'editing')}></button>
    } else {
        return <button className={className} onClick={testFun(id, 'del')}></button>
    }


}

export default TaskButton;
